export default function ItemListContainer () { 

    return (
        <div>
            <h1>Welcome to Coder Grocery!</h1>
            <ul>
                <li>Carrots</li>
                <li>Broccoli</li>
                <li>Apples</li>
                <li>Oranges</li>
            </ul>     
        
        </div>
    )
}
